import AsyncStorage from "@react-native-async-storage/async-storage";

const getCategories = () => new Promise(resolve => {
    AsyncStorage.getItem("categories")
        .then(res => resolve(res ? JSON.parse(res) : []));
});

export {
    getCategories
}
